/*
 * HRTF Measurements of a KEMAR Dummy-Head Microphone
 * Bill Gardner and Keith Martin
 * MIT Media Lab
 *
 * Abstract:
 * An extensive set of head-related transfer function (HRTF) measurements
 * of a KEMAR dummy head microphone was completed in May, 1994.
 *
 * The measurements consist of the left and right ear impulse responses
 * from a Realistic Optimus Pro 7 loudspeaker mounted 1.4 meters from the
 * KEMAR. Maximum length (ML) pseudo-random binary sequences were used to
 * obtain the impulse responses at a sampling rate of 44.1 kHz. A total
 * of 710 different positions were sampled at elevations from -40 degrees
 * to +90 degrees. Also measured were the impulse response of the speaker
 * in free field and several headphones placed on the KEMAR. This data is
 * being made available to the research community on the Internet via
 * anonymous FTP and the World Wide Web.
 *
 * Usage restrictions
 * This HRTF data is Copyright 1994 by the MIT Media Lab.  It is provided
 * without any usage restrictions.  We request that you cite the authors
 * when using this data for research or commercial applications.
 *
 */

